    { key: 2, text: 'UNI', value: 2 },
    { key: 3, text: 'DAI', value: 3 },
  ]

class Otoken extends React.Component {

    render(){
        return(
            <div>
              <Input
              className="token-input"
    label={<Dropdown defaultValue='.com' options={options} />}
    labelPosition='left'
    placeholder='Select Token'
  />

           <Input
    label={<Dropdown defaultValue='.com' options={options} />}
